import React from 'react';
import './css/Note.css';

function NoteSearch({handleSearch}){

    const handleKeyPress = (e) => {
        if (e.key === "Enter"){
            handleSearch(e.target.value);
        }else{
            handleSearch("");
        }
    }
    return (
        <div>           
            <input onChange={handleKeyPress}
            type='text' placeholder="Search..."/>
        </div>
    );
}

export default NoteSearch;
